// src/components/AnimationSection.jsx
import React from 'react';

const AnimationSection = () => {
  return (
    <section className="bg-blue-100 py-20">
      <div className="container mx-auto text-center">
        <h2 className="text-4xl font-bold mb-12">Drag2Drop</h2>
        <p className="text-xl mb-8">Simply drag your pre-filled information and drop it into the corresponding fields on any job application form.</p>
        <div className="flex justify-center space-x-4">
          <div className="bg-white p-6 rounded shadow-md">
            <img src="/path/to/image1.png" alt="Graph 1" />
          </div>
          <div className="bg-white p-6 rounded shadow-md">
            <img src="/path/to/image2.png" alt="Graph 2" />
          </div>
        </div>
      </div>
    </section>
  );
};

export default AnimationSection;
